(3, 'Tentang Kami', '<p>\r\n	<img alt="" src="https://permatanetwork.com/ag/0/source/permata%20gedung.png" style="width: 345px; height: 396px; float: left; margin-left: 10px; margin-right: 10px;" /></p>\r\n<p style="margin-left: 240px;">\r\n	<span style="font-size:16px;">PermataNetwork.com bergerak dibidang Pemasaran Langsung Cincin Batu Permata melalui sistem MLM (Real Bisnis MLM).</span></p>\r\n<p style="margin-left: 160px;">\r\n	<span style="font-size:16px;">Batu Permata Amethyst/Kecubung yang dipasarkan semuanya adalah Natural/Asli.</span></p>\r\n<p style="margin-left: 160px;">\r\n	&nbsp;</p>\r\n<p style="margin-left: 160px;">\r\n	<span style="font-size:16px;">Lokasi Kantor sangat strategis di pusat Business Distrik antara Jakarta Barat dan Jakarta Pusat.</span></p>\r\n<p style="margin-left: 160px;">\r\n	<span style="font-size:16px;">BOP (Business Opportunity Presentation) dan Pengambilan Barang Stokist Cincin Batu Permata bertempat di:</span></p>\r\n<p style="margin-left: 160px;">\r\n	<span style="font-size:16px;"><strong>Grand Slipi Tower Lantai 21, Slipi</strong>, Jakarta Barat (Perempatan Palmerah atau Seberang Hotel Ibis Slipi)</span></p>\r\n<p style="margin-left: 160px;">\r\n	<span style="font-size:16px;"><strong>BOP setiap hari dan setiap jam</strong> kecuali hari Libur jam 2pm, 3pm, 4pm, 5pm, 6pm dan 7pm.</span></p>\r\n<p>\r\n	<span style="font-size:16px;">Datang bersama partner bisnis anda, dan temukan peluang yg dahsyat dengan Modal 1juta berpotensi dapatkan Milyaran Rupiah dalam waktu singkat 2&nbsp;hingga 3 bulan pertama.</span></p>\r\n<p style="margin-left: 80px;">\r\n	&nbsp;</p>\r\n<p>\r\n	<span style="font-size:16px;">Salam Permatanetwork.com</span></p>\r\n', 1, 'tentang-kami', '2015-07-24 10:01:54', '2015-07-24 10:01:54');
